import clsx from "clsx";
// import { Moon, Sun, Menu, LayoutDashboard } from 'lucide-react';
import {FaMoon, FaSun } from "react-icon/fa";
import { HiOutlineMenuAlt2 } from "react-icons"

const Headers = () => {
    return (
        <nav className={clsx("fixed top-0 z-50 w-full bg-white", 
            "border-b border-gray-200 dark:bg-gray-800 dark:border-gray-700")}>
            <div className="px-3 py-3 lg:px-5 lg:pl-3">
                <div className="flex items-center justify-between">
                    <div className="flex items-center justify-start rtl:justify-end">
                        <button>
                            <Menu className="text-2xl"/>
                        </button>
                        <a href="/#">
                            <LayoutDashboard className="h-8 me-3 text-xl text-violet-500" />
                            <span className="text-xl font-semibold whitespace-nowrap dark:text-white">AStock</span>
                        </a>
                    </div>
                </div>
            </div>    
        </nav>
    );
};
export default Headers;
